{default:case 'string':msg = utf8Encode(msg);break;case 'hex-bytes':msg = hexBytesToString(msg);break;}const K=[0x428a2f98,0x71374491,0xb5c0fbcf,0xe9b5dba5,
0x3956c25b,0x59f111f1,0x923f82a4,0xab1c5ed5,0xd807aa98,0x12835b01,0x243185be,0x550c7dc3,0x72be5d74,0x80deb1fe,0x9bdc06a7,0xc19bf174,0xe49b69c1,0xefbe4786,
0x0fc19dc6,0x240ca1cc,0x2de92c6f,0x4a7484aa,0x5cb0a9dc,0x76f988da,0x983e5152,0xa831c66d,0xb00327c8,0xbf597fc7,0xc6e00bf3,0xd5a79147,0x06ca6351,0x14292967,
0x27b70a85,0x2e1b2138,0x4d2c6dfc,0x53380d13,0x650a7354,0x766a0abb,0x81c2c92e,0x92722c85,0xa2bfe8a1,0xa81a664b,0xc24b8b70,0xc76c51a3,0xd192e819,0xd6990624,
0xf40e3585,0x106aa070,0x19a4c116,0x1e376c08,0x2748774c,0x34b0bcb5,0x391c0cb3,0x4ed8aa4a,0x5b9cca4f,0x682e6ff3,0x748f82ee,0x78a5636f,0x84c87814,0x8cc70208,
0x90befffa,0xa4506ceb,0xbef9a3f7,0xc67178f2];const H=[0x6a09e667,0xbb67ae85,0x3c6ef372,0xa54ff53a,0x510e527f,0x9b05688c,0x1f83d9ab,0x5be0cd19];
msg += String.fromCharCode(0x80); const l = msg.length/4 + 2; const N = Math.ceil(l/16); const M = new Array(N);for(let i=0;i<N;i++){M[i]=new Array(16);
for(let j=0;j<16;j++){M[i][j]=(msg.charCodeAt(i*64+j*4+0)<<24)|(msg.charCodeAt(i*64+j*4+1)<<16)|(msg.charCodeAt(i*64+j*4+2)<<8)|(msg.charCodeAt(i*64+j*4+3)<< 0);
}}const lenHi=((msg.length-1)*8)/Math.pow(2, 32);const lenLo=((msg.length-1)*8)>>>0;M[N-1][14]=Math.floor(lenHi);M[N-1][15]=lenLo;for(let i=0;i<N;i++){const W=new Array(64);

for(let t=0;t<64;t++){const T1=h+Sha256.SiGmA1(e)+Sha256.Ch(e,f,g)+K[t]+W[t];const T2=Sha256.SiGmA0(a)+Sha256.Maj(a,b,c);h=g;g=f;f=e;e=(d+T1)>>>0;d=c;c=b;b=a;
a=(T1+T2)>>>0;}H[0]=(H[0]+a)>>>0;H[1]=(H[1]+b)>>>0;H[2]=(H[2]+c)>>>0;H[3]=(H[3]+d)>>>0;H[4]=(H[4]+e)>>>0;H[5]=(H[5]+f)>>>0;H[6]=(H[6]+g)>>>0;H[7]=(H[7]+h)>>>0;
}for(let h=0;h<H.length;h++) H[h]=('00000000'+H[h].toString(16)).slice(-8);const separator = opt.outFormat=='hex-w' ? ' ' : '';return H.join(separator);
function utf8Encode(str){try {return new TextEncoder().encode(str, 'utf-8').reduce((prev, curr) => prev + String.fromCharCode(curr), '');} catch (e) {
return unescape(encodeURIComponent(str));}}function hexBytesToString(hexStr){const str = hexStr.replace(' ', '');return str=='' ? '' : 
str.match(/.{2}/g).map(byte => String.fromCharCode(parseInt(byte, 16))).join('');}}static ROTR(n, x){return (x >>> n) | (x << (32-n));}
static SiGmA0(x){ return (Sha256.ROTR(2,  x) ^ Sha256.ROTR(13, x) ^ Sha256.ROTR(22, x))};static SiGmA1(x){return (Sha256.ROTR(6,  x) ^ Sha256.ROTR(11, x) ^ Sha256.ROTR(25, x))};

	<script>
function Wiktionary(f){
	window.location = "https://en.wiktionary.org/wiki/" + f.word.value;
}
function Passwd(f){
	var table = {
		"twitter": {"full": "Twitter, Inc.", "len": 99},
		"google": {"full": "Google Inc.", "len": 17},
		"dgc": {"full": "dosgameclub", "len": 12},
		"paypal": {"full": "Paypal, Inc.", "len": 20, "at": true},
		"akj": {"full": "Alakajam!", "len": 99},
		"aliexpress": {"full": "AliExpress", "len": 20},
		"twitch":  {"full": "Twitch", "len": 20},
		"humblebundle": {"full": "Humble Bundle, Inc.", "len": 99},
		"reddit": {"full": "le reddit XD", "len": 99}
	};
	var pass = f.pass.value;
	var place = f.place.value;
	var placeFull = table[place].full;
	var toHash = placeFull + pass + "\n";
	var hashed = Sha256.hash(toHash);
	var hashedArr = hashed.match(/.{1,2}/g).map(v=>parseInt(v,16));
	hashedArr.push(0x0A);
	hashedArr.push(0xDA);
	var hashedArrU8 = new Uint8Array(hashedArr);
	var hashedBtoa = btoa(String.fromCharCode.apply(null, hashedArrU8));
	var len = table[place].len;
	var at = table[place].at;
	var result = hashedBtoa;
	if(result.length > len) result = result.substr(0, len);
	if(at){
		if(result.indexOf("@") < 0) result = result.replace("A", "@");
		if(result.indexOf("@") < 0) result = result.replace("a", "@");
		if(result.indexOf("@") < 0) result = result.replace("4", "@");
		if(result.indexOf("@") < 0) result = result.replace("B", "@");
		if(result.indexOf("@") < 0) result = result.replace("C", "@");
		if(result.indexOf("@") < 0) result = result.replace("D", "@");
		if(result.indexOf("@") < 0) result = result.replace("E", "@");
		if(result.indexOf("@") < 0) result = result.replace("F", "@");
		if(result.indexOf("@") < 0) result = result.replace("G", "@");
		if(result.indexOf("@") < 0) result = result.replace("H", "@");
		if(result.indexOf("@") < 0) result = result.replace("I", "@");
		if(result.indexOf("@") < 0) result = result.replace("J", "@");
		if(result.indexOf("@") < 0) result = result.replace("K", "@");
		if(result.indexOf("@") < 0) result = result.replace("L", "@");
		if(result.indexOf("@") < 0){
			alert("Couldn't place @");
			result = "ERROR";
		}
	}
	document.getElementById("result").innerText = result;
	return false;
}
	</script>
